import React from 'react';
import "./App.css"
const App=()=>{
    let count=1;
    const add=()=>{
        count++;
    }
    const less=()=>{
        count--;
        console.log()
    }
    return <div className='app'>
        <h1>{count}</h1>
        <button onClick={add}>-</button>
        <button onClick={less}>+</button>
    </div>
}
export default App;
